import Link from 'next/link';

const linkStyle = {
    background: 'blue',
    display: 'inline-flex',
    alignContent: 'center'
  };
 


  const Navbar = () => (
    <div>
      <Link href="/">
        <a style={linkStyle}>Home</a>
      </Link>
      <Link href="/about">
        <a style={linkStyle}>About</a>
      </Link>
    </div>
    
  );
  
  export default Navbar;
